// load the horns

window.sounds = new Array();

/* horn64 */  window.sounds[0] = new Audio("data:audio/mp3;base64,");
/* gat64 */ window.sounds[1]  = new Audio("data:audio/mp3;base64,");
/* td4w64 */ window.sounds[2]  = new Audio("data:audio/mp3;base64,");
/* dewae64 */ window.sounds[3]  = new Audio("data:audio/mp3;base64,");
/* notdewae64 */ window.sounds[4]  = new Audio("data:audio/mp3;base64,");
/* yass */  window.sounds[5] = new Audio("data:audio/mp3;base64,");
/*beeb*/ window.sounds[6]  = new Audio('data:audio/ogg;base64,');
/* oh yeah */ window.sounds[7] = new Audio("data:audio/mp3;base64,");
/* ricola */ window.sounds[8] = new Audio("data:audio/mp3;base64,");
/* draxx them */ window.sounds[9] = new Audio("data:audio/mp3;base64,");
/* damnson */ window.sounds[10] = new Audio("data:audio/mp3;base64,");

function stopSound(number) {
    if (sounds[number]) {
        sounds[number].stop();
    }
}
function playSound(number, overlapping = false) {

    if(sounds[number]){
      var snd = new Audio();
      if( overlapping ) {
          snd = sounds[number].cloneNode();
          snd.play();
       }
       else { sounds[number].play(); }
    }
      //sounds[number].play();
      snd = undefined;
}

//Keyboard support
window.onkeydown = function(event){
	event = event || window.event;
    	var keycode = event.charCode || event.keyCode;
    	var overlapping = true;
    	var notOverlapping = false;
	   //Spacebar Horn
    	if(keycode == 32){
        	playSound(0, overlapping);
    	}
    	//G key triggers Gat
    	if(keycode == 71){
    		playSound(1, overlapping);
    	}
    	  //R key triggers Ricola
        if (keycode == 82){
            playSound(8, notOverlapping);
        }
        
    	  //S key triggers Ricola
        if (keycode == 83){
            playSound(10, notOverlapping);
        }
        //T key triggers TD4W
        if (keycode == 84){
            playSound(2, notOverlapping);
        }
        //D key triggers Drax
        if (keycode == 68){
            playSound(9, notOverlapping);
        }
        //N key does not know De Wae
        if (keycode == 78){
            playSound(4, notOverlapping);
        }
        if (keycode == 79){
            playSound(7, notOverlapping);
        }
        //B key does Beeb
        if (keycode == 66){
            playSound(6, overlapping);
        }
        //Y key does Yas
        if (keycode == 89){
            playSound(5, overlapping);
        }
         
}

